	console.log("Checking tar for " + fn);
	if (window.com && com.nt4 && com.nt4.Tar && com.nt4.Tar.filenames && com.nt4.Tar.filenames[fn]) {
		console.log("Found " + fn + " in tar");
		return com.nt4.Tar.filenames[fn].data.toDataURL();
	} 
