jsload.syncload = function(scripts, cb) {
	var i;
	if (jsload.syncloadrun && scripts && scripts.length) {
		console.log("aborting additional syncload", scripts);
		return;
	}
	jsload.syncloadrun = true;
	if (cb) jsload.callbacks.push(cb);
	if (scripts) {
		for (i=0; i < scripts.length; i++) {
			expand(scripts[i]).forEach( function(script,k) {
				console.log("Queuing " + script + " #" + jsload.scripts.length);
				var ts = jsload.checkTar(script);
				var n;
				if (!~(n = jsload.scripts.indexOf(ts))) {
					jsload.scripts.push(ts);
				}
				else {
					console.log('Dupe script: ' + ts);
					delete jsload.scripts[n];
					jsload.scripts.push(ts);
				}
			});
			// Array.prototype.push.apply(jsload.scripts, expand(scripts[i])
		}
		jsload.scripts = jsload.scripts.filter(function(v) { return v })
		console.log("Queuing complete " + jsload.scripts.length);
	}
	if (jsload.scripts.length) {
		jsload.include_script(jsload.scripts.shift(), jsload.syncload); // function() { jsload.syncload(); });
	} else {
		console.log("syncload complete, callbacks now.");
		if (jsload.callbacks.length) {
			for (i=0; i < jsload.callbacks.length; i++) {
				console.log("Calling callbacks " + i);
				jsload.callbacks[i]();
			}
		}
	}
};

if (extraScripts) {
	console.log("Loading URI derived scripts: ", extraScripts);
	jsload.syncload(extraScripts);
}

